import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './register.css';
import AuthService from './AuthService';

const Register = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [nationality, setNationality] = useState('');
  const [error, setError] = useState('');

  const handleFirstNameChange = (event) => {
    setFirstName(event.target.value);
  };

  const handleLastNameChange = (event) => {
    setLastName(event.target.value);
  };

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleNationalityChange = (event) => {
    setNationality(event.target.value);
  };

  const handleRegisterClick = () => {
    AuthService.register(firstName, lastName, email, password, nationality)
      .then(() => {
        // Redirect the user to the dashboard or any other page
        redirectToMyPage();
      })
      .catch((error) => {
        setError(error.message);
      });
  };

  return (
    <form className="registerForm">
      <h2>Register</h2>
      {error && <div className="error">{error}</div>}
      <div>
        <label htmlFor="firstName">First Name:</label>
        <input type="text" id="firstName" value={firstName} onChange={handleFirstNameChange} required />
      </div>
      <div>
        <label htmlFor="lastName">Last Name:</label>
        <input type="text" id="lastName" value={lastName} onChange={handleLastNameChange} required />
      </div>
      <div>
        <label htmlFor="email">Email:</label>
        <input type="text" id="email" value={email} onChange={handleEmailChange} required />
      </div>
      <div>
        <label htmlFor="password">Password:</label>
        <input type="password" id="password" value={password} onChange={handlePasswordChange} required />
      </div>
      <div>
        <label htmlFor="nationality">Nationality:</label>
        <input type="text" id="nationality" value={nationality} onChange={handleNationalityChange} required />
      </div>
      <button type="button" className="button" onClick={handleRegisterClick}>
        Register
      </button>
      <Link to="/login" className="already-have-account">
        Got an account? Login
      </Link>
    </form>
  );
};

export default Register;
